import React from 'react';
import { connect } from 'react-redux';

class Band extends React.Component {

  render() {
    return (
      <div>
        {this.props.currentBand.name}<br/>
        {this.props.currentBand.bandId}
        {this.props.currentBand.stanCount}
        {this.props.currentBand.profileImage}
        {this.props.currentBand.introducerUserId}
      </div>
    );
  }

}

const mapStateToProps = state => {
  return {
    currentBand: state.bandSearch.selected
  };
};

export default connect(
  mapStateToProps
)(Band);
